def find_largest_square_side_length(circles):
    if not circles:
        return 0.0
    N = len(circles)
    e = 2 ** 0.5 * 2
    r_min = max((r * e for (x, r) in circles))
    r_max = max((r for (x, r) in circles))
    H = []
    for i in range(N - 1):
        (x0, r0) = circles[i]
        (x1, r1) = circles[i + 1]
        dx = x1 - x0
        l = (r0 ** 2 + dx ** 2 - r1 ** 2) / (2 * dx)
        h = (r0 ** 2 - l ** 2) ** 0.5
        H.append(h)

    def check(h):
        k = -1
        for i in range(N):
            (xi, ri) = circles[i]
            if k == -1:
                if h <= ri:
                    k = i
            elif H[i - 1] < h:
                if k != -1:
                    (xp, rp) = circles[k]
                    (xq, rq) = circles[i - 1]
                    x0 = xp - (rp ** 2 - h ** 2) ** 0.5
                    x1 = xq + (rq ** 2 - h ** 2) ** 0.5
                    if x1 - x0 >= 2 * h:
                        return True
                if h <= ri:
                    k = i
                else:
                    k = -1
        if k == -1:
            return False
        (xp, rp) = circles[k]
        (xq, rq) = circles[N - 1]
        x0 = xp - (rp ** 2 - h ** 2) ** 0.5
        x1 = xq + (rq ** 2 - h ** 2) ** 0.5
        return x1 - x0 >= 2 * h
    left = r_min
    right = r_max + 1
    EPS = 1e-05
    while right - left > EPS:
        mid = (left + right) / 2
        if check(mid):
            left = mid
        else:
            right = mid
    return left * 2

